    const card1name = document.getElementById("card-1-name");
    const card2name = document.getElementById("card-2-name");
    const card1phonetic = document.getElementById("card-1-phonetic");
    const card2phonetic = document.getElementById("card-2-phonetic");
    const card1place = document.getElementById("card-1-place");
    const card2place = document.getElementById("card-2-place");
    const card1voice = document.getElementById("card-1-voice");
    const card2voice = document.getElementById("card-2-voice");
    const card1manner = document.getElementById("card-1-manner");
    const card2manner = document.getElementById("card-2-manner");
    const cardplaceheader = document.getElementById("card-place-header");
    const cardvoiceheader = document.getElementById("card-voicing-header");
    const cardmannerheader = document.getElementById("card-manner-header");
